const NotFoundPage = () => {
  return (
    <>
      <div className="w-[100vw] h-[100vh] text-center text-[80px] font-bold tracking-widest">
        <div className="translate-y-24">
          <div className="top-[20%] left-[18%]">404</div>
          <div className="top-[20%] left-[18%]">Not Found</div>
        </div>
      </div>
    </>
  );
};
export default NotFoundPage;
